function getTitle(){
  const [articulos, setArticulos] = useState([])

  useEffect(() => {
    fetch('https://www.themealdb.com/api/json/v1/1/random.php')
      .then((response) => {
        return response.json()
      })
      .then((articulos) => {
        setArticulos(articulos)
      })
  }, [])
  return (
    <h1>{articulos.meals[0].strMeal}</h1>
  )
}
